###SITEURL###','Only UUID V4 is supported at this time.'=>'در حال حاضر تنها از UUID V4 پشتیبانی می‌شود.','The Press This plugin is required.'=>'افزونه \'انتشار این\'، مورد نیاز است.','%s themes'=>'%s پوسته','Filter themes (%s)'=>'پالایه پوسته‌ها (%s)','Go to theme sources'=>'بازگشت به منابع پوسته','Search WordPress.org themes'=>'جست‌وجوی پوسته‌های WordPress.org','Install &amp; Preview'=>'نصب و پیش‌نمایش','Invalid URL.'=>'نشانی نامعتبر است.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'حالا پیوند‌ها را اضافه کنید. &#8220;%s&#8221; را برای افزودن برگه‌ها، دسته‌ها، و پیوندهای سفارشی در فهرست‌تان کلیک کنید. به مقدار لازم!','Choose image'=>'انتخاب تصویر','Choose audio'=>'انتخاب صدا','Change audio'=>'تغییر صدا','Select audio'=>'صدا را انتخاب کنید','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'برای بارگذاری یک پرونده تصویری از روی رایانه خود، روی «افزودن تصویر تازه» کلیک کنید. پوسته شما با تصویر سربرگی به ارتفاع %s پیکسل بهترین کارایی را دارد&#8212; پس از بارگذاری می‌توانید تصویر را برای تناسب کامل، برش دهید.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'برای بارگذاری یک پرونده تصویری از روی رایانه خود، روی «افزودن تصویر تازه» کلیک کنید. پوسته شما با تصویر سربرگی به عرض %s پیکسل بهترین کارایی را دارد&#8212; پس از بارگذاری می‌توانید تصویر را برای تناسب کامل، برش دهید.','Click &#8220;Add Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>