ا را در %s محدوده نمایش دهد.','Your theme can display menus in one location.'=>'پوستهٔ شما می‌تواند فهرست‌ها را فقط در یک محدوده نمایش دهد.','CSS code'=>'کد css','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'فیلد ویرایش، به صورت خودکار ساختار کد را رنگ‌بندی می‌کند. می‌توانید این امکان را در <a href="%1$s" %2$s>نمایه خودتان</a> غیرفعال و از حالت متن ساده استفاده کنید.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'کاربران صفحه‌خوان: در هنگام حالت فرم‌ها، ممکن است نیاز به فشردن دوبار کلید Esc داشته باشید.','To move away from this area, press the Esc key followed by the Tab key.'=>'برای عبور از این عرصه، کلید Esc به همراه کلید Tab را فشار دهید.','In the editing area, the Tab key enters a tab character.'=>'در عرصه ویرایش، کلید Tab یک نویسه tab وارد می‌کند.','When using a keyboard to navigate:'=>'هنگامی که از صفحه‌کلید برای راه‌بری استفاده می‌کنید:','Add your own CSS code here to customize the appearance and layout of your site.'=>'برای سفارشی‌کردن طرح‌بندی و پیدایش سایت، کد CSS خود را در اینجا اضافه کنید.','Your homepage displays'=>'صفحه اصلی شما شامل','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'می‌توانید انتخاب کنید که چه چیزی در صفحه خانه سایت‌تان نمایش داده شود. می‌تواند نوشته‌ها در ترتیب زمانی معکوس (بلاگ کلاسیک)، یا برگه ایستا/ثابت باشد. برای تنظیم صفحه خانه ایستا، ابتدا نیاز به ایجاد دو برگه دارید. یکی برای صفحه خانه و دیگری جایی که نوشته‌های شما نمایش داده شود.','Homepage Settings'=>'تنظیمات برگه خانه','WordPress.org themes'=>'پوسته‌های WordPress.org','Installed themes'=>'پوسته‌های نصب شده','Publish Settings'=>'تنظیمات انتشار','Copied'=>'کپی شد','Preview Link'=>'پیش‌نمایش پیوند','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'به صورت زنده مشاهده کنید که تغییرات، چگونه در وب‌سایت شما نمایش داده خواهند شد، و پیش‌نمایش را با افرادی که نمی‌توانند به قسمت سفارشی‌سازی دسترسی داشته باشند، به اشتراک بگذارید.','Share Preview Link'=>'اشتراک پیوند پیش‌نمایش','Changes trashed successfully.'=>'تغییرات با موفقیت به زباله‌دان منتقل شده‌اند.','Changes have already been trashed.'=>'تغییرات در حال حاضر به زباله‌دان منتقل شده‌اند.','Unable to trash changes.'=>'عدم توانایی در انتقال تغییرات به زباله‌دان.','No changes saved yet, so there is nothing to trash.'=>'هیچ تغییری هنوز ذخیره نشده است، بنابراین چیزی برای ارسال به زباله‌دان وجود ندارد.','There was an authentication problem. Please reload and try again.'=>'مشکلی با احراز هویت وجود داشت. لطفاً دوباره بارگذاری و تلاش کنید.','Unable to save due to %s invalid setting.'=>'ذخیره‌سازی به دلیل %s تنظیم نامعتبر، ناممکن است.' . "\0" . 'ذخیره‌سازی به دلیل %s تنظیم نامعتبر، ناممکن است.','You must supply a future date to schedule.'=>'برای زمان‌بندی باید تاریخی را وارد کنید که در آینده باشد.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'مجموعه قبلی از تغییرات در حال حاضر منتشر شده است. لطفا مجموعه تغییرات فعلی خود را مجددا ذخیره کنید.','Edit User'=>'ویرایش کاربر','View User'=>'مشاهده کاربر','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Code&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'به نظر میرسد کد HTML را در زبانه &#8220;دیداری&#8221; ابزارک متن چسبانده‌اید. در عوض ممکن است بخواهید کد خود را در زبانه &#8220;متن&#8221; بچسبانید. همچنین، می‌توانید ابزارک تازه &#8220;سفارشی HTML&#8221; را امتحان کنید!','Did you just paste HTML?'=>'آیا همین الان HTML قرار دادید؟','Did you know there is a &#8220;Custom HTML&#8221; widget now? 